define(['model', 'snap', 'base64', 'jpgEncoder', 'canvg'], function (SiteModel) {
        var view = {
            picUrl: "",
            prdId: "",
            isAgree: true,
            init: function () {
                var _self = this;

                $("#agreeBox").on("click", function () {
                    if (_self.isAgree) {
                        $("#agreeBox").addClass("unagree");
                        $("#buybtn").addClass("noclickbuy");
                        _self.isAgree = false;

                    } else {
                        $("#agreeBox").removeClass("unagree");
                        $("#buybtn").removeClass("noclickbuy");
                        _self.isAgree = true;
                    }


                })

                $("#buybtn").on("click", function () {
                        //console.log(window.userTypeTxt);
                        var b = window.TP.getTradeParams();
                        var dataObj = {
                            itemId: b.itemId,
                            skuId: b.skuId,
                            text: [{id: parseInt(_self.prdId), content: window.userTypeTxt}],
                            pic: [{
                                id: parseInt(_self.prdId),
                                url: _self.picUrl
                            }]
                        }
                        window.TP.submitTradeData(dataObj)
                        SiteModel.playAudio("ButtonClick");

                        SiteModel.track("click_pc", "Step6-Buy");
                    }
                )
                ;

                $("#btn_again").on("click", function () {
                    SiteModel.track("click_pc", "Step6-Again");

                    window.location.reload();
                    SiteModel.playAudio("ButtonClick");


                });

                $("#btn_blost").on("click", function () {


                    var shareContentArr = ['怎么办？画完了，就舍不得吃了~', '我不会做饼干，但我会做饼干盒子！', '我有本事“画”一盒自己的饼干！你有本事你上天！', '感觉自己屌爆了！快来膜拜我~'];
                    var shareContent = shareContentArr[Math.floor(Math.random() * shareContentArr.length)];
                    var domain = "http://v.t.sina.com.cn/share/share.php?title="
                    var backurl = "https://detail.tmall.com/item.htm?spm=0.0.0.0.Bu2Qs6&id=530768014497"

                    var url = domain + encodeURIComponent(shareContent) + encodeURIComponent(backurl) + "&pic=" + _self.picUrl + "&url=" + encodeURIComponent(backurl) + "&backurl=" + encodeURIComponent(backurl);
                    // window.location.href = url;
                    window.open(url);
                    //  window.open(url, 'width=500,height=500,resizable=0,scrollbars=auto');

                    // document.showModelessDialog(url,'dialogWidth:400px;dialogHeight:300px;dialogLeft:200px;dialogTop:150px;center:yes;help:yes;resizable:yes;status:yes');
                    SiteModel.playAudio("ButtonClick");

                    SiteModel.track("click_pc", "Step5-Share-BTN");
                });

                this.setData();
            },
            setData: function () {
                var _self = this;
                $("#page5").hide();
                $("#saving ").show();
                var svgXml = Snap($("#mysvg").get(0)).toString();
                svgXml = svgXml.replace('preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg"', 'preserveAspectRatio="xMidYMid meet"')
                var canvas = document.createElement('canvas');  //准备空画布
                //canvas.width = $("#mysvg").width();
                //canvas.height = $("#mysvg").height();
                var b64;
                var b64_2;

                var boxs = $("#boxstroke").get(0).getScreenCTM();


                canvg(canvas, svgXml, {
                    'renderCallback': function () {
                        var context = canvas.getContext("2d");
                        // var scale = (_h / 1.8) / 400;
                        //   context.scale(scale, scale);
                        // context.translate(300, 100);
                        var margin = 60;
                        var data = context.getImageData($("#mysvg").width() / 2 + ( boxs.a * (-238 - margin)), $("#mysvg").height() / 2 + ( boxs.a * (-185 - margin)), boxs.a * (465 + 2 * margin), boxs.a * (345 + 2 * margin));
                        var encoder = new JPEGEncoder();
                        b64 = encoder.encode(data, 90);

                        var img2 = new Image();
                        img2.width = 496;
                        img2.height = 394;


                        var bgb64 = "data:image/png;base64,"


                        img2.src = b64;
                        img2.crossOrigin = 'Anonymous'; //解决跨域;

                        img2.onload = function () {
                            var canvas2 = document.createElement('canvas');
                            var ctx = canvas2.getContext("2d");
                            canvas2.width = 500;
                            canvas2.height = 766;
                            ctx.rect(0, 0, canvas2.width, canvas2.height);
                            ctx.fillStyle = '#fff';
                            ctx.fill();

                            ctx.drawImage(img2, 4, 143, 496, 394);
                            var sharePicBg = new Image();
                            sharePicBg.src = bgb64;
                            // $("body").append(sharePicBg);
                            sharePicBg.crossOrigin = 'Anonymous'; //解决跨域;
                            sharePicBg.onload = function () {
                                ctx.drawImage(sharePicBg, 0, 0);
                                //       $("#share_wbPic").get(0).crossOrigin = 'Anonymous'; //解决跨域
                                //  ctx.drawImage($("#share_wbPic").get(0), 0, 0);
                                b64_2 = canvas2.toDataURL("image/jpg", 90);

                                //var img = new Image();
                                //img.src = b64_2;
                                //img.style.position = 'absolute';
                                //$("body").append(img2);
                                //$("body").append(img);

                                var oldstr = Snap($("#mysvg").get(0)).toString();
                                oldstr = oldstr.replace('preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg"', 'preserveAspectRatio="xMidYMid meet"');
                                window.boxSvg.select("#boxPrint").attr({
                                    display: "block"
                                });
                                window.boxSvg.select("#boxstroke").remove();
                                window.boxSvg.select("#boxShadow").remove();
                                window.boxSvg.select("#whitebg").remove();
                                var lable = '<?xml version="1.0" encoding="utf-8" ?>';

                                var printSvg = Snap($("#mysvg").get(0)).toString();

                                printSvg = printSvg.replace('preserveAspectRatio="xMidYMid meet" xmlns="http://www.w3.org/2000/svg"', 'preserveAspectRatio="xMidYMid meet"');
                                //   console.log(printSvg);

                                var str = lable + printSvg;
                                $("#mysvg").remove();

                                var workId;
                                $("#svgContainer").append(oldstr);
                                $.get("background/saveWork.json?s=User/doSaveWork",
                                    {
                                        svg: str
                                    },
                                    function (data) {
                                        var val = JSON.parse(data);
                                        //console.log(val);
                                        workId = val.data.workId;
                                        $.get("background/saveImage.json?s=User/doSaveImg",
                                            {
                                                id: workId,
                                                file: b64,
                                                composeFile: b64_2,
                                                content: window.userTypeTxt
                                            },
                                            function (data) {
                                                var val = JSON.parse(data);
                                                //console.log(val);
                                                //  _self.picUrl = val.data.url;
                                                _self.picUrl = val.data.composeUrl;
                                                _self.prdId = val.data.workId;
                                                $("#page5").show();
                                                $("#saving ").hide();
                                                $(".workIdTag").show();
                                                $(".header").hide();
                                                $("#workIdTxt").text(_self.prdId);
                                            });

                                    });


                            };


                        }


                    }
                });


            }
        }
        return view
    }
)
